# part 2 solved by hand

input = """
Al => ThF
Al => ThRnFAr
B => BCa
B => TiB
B => TiRnFAr
Ca => CaCa
Ca => PB
Ca => PRnFAr
Ca => SiRnFYFAr
Ca => SiRnMgAr
Ca => SiTh
F => CaF
F => PMg
F => SiAl
H => CRnAlAr
H => CRnFYFYFAr
H => CRnFYMgAr
H => CRnMgYFAr
H => HCa
H => NRnFYFAr
H => NRnMgAr
H => NTh
H => OB
H => ORnFAr
Mg => BF
Mg => TiMg
N => CRnFAr
N => HSi
O => CRnFYFAr
O => CRnMgAr
O => HP
O => NRnFAr
O => OTi
P => CaP
P => PTi
P => SiRnFAr
Si => CaSi
Th => ThCa
Ti => BP
Ti => TiTi
e => HF
e => NAl
e => OMg


"""

rules = []
target = ""
molecules = set()

split = input.strip().split("\n\n")
for l in split[0].strip().split("\n"):
  key = l.split(" => ")[0]
  val = l.split(" => ")[1]
  rules.append({key: val})
target = split[1]

# print(rules)
# print(target)

pos = 0
while pos < len(target):
  generated_molecule = "" 
  for rule in rules:
    for k, v in rule.items():
      if k == target[pos:pos+len(k)]:
        # print(target[pos], v)
        generated_molecule = target[:pos] + v + target[pos+len(k):]
        molecules.add(generated_molecule)
  pos += 1

print("star 1:",len(molecules))